import React, { Component } from 'react'
import { Table, Card ,Modal,ModalBody,ModalFooter,ModalHeader} from 'react-bootstrap';
import "bootstrap/dist/css/bootstrap.min.css"
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faEdit,faTrashAlt} from '@fortawesome/free-solid-svg-icons'


class EmpleadoPlanilla extends Component {
    constructor(...props) {
        super(...props);
        this.state = {
            empleadoP: [],
        }
    }
    cargarDatos() {
        fetch('http://localhost:4201/api/empleado-planilla',
            {
                method: "GET",
                headers: {'Content-Type': 'application/json'
                }
            })
            .then((response) => {
                return response.json()
            })
            .then((res) => {
                this.setState({
                    empleadoP: res.empleadoP
                })
            })
            .catch(function (error) {
                console.log('Hubo un problema con la petición:' + error.message);
            });
    }
    componentDidMount() {
        this.cargarDatos();
    }
    render() {
        const { empleadoP } = this.state;
        console.log('Empleado', empleadoP)
        return (
            <>
                <h2>Lista de Empleados</h2>
                <Table striped bordered hover variant="dark">
                    <thead>
                        <tr>
                            <th>idusuario</th>
                            <th>ocupacion</th>
                            <th>Fecha de Ingres</th>
                            <th>Fecha de salida</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            (empleadoP)
                                ?
                                empleadoP.map(item => (

                                    <tr key={item._id}>
                                        <td>{item.idusuario}</td>
                                        <td>{item.ocupacion}</td>
                                        <td>{item.fecha_ingreso}</td>
                                        <td>{item.fecha_salida}</td>
                                    </tr>

                                ))
                                :
                                <tr></tr>}
                    </tbody>
                </Table>
            </>
        )
    }
}
export default EmpleadoPlanilla
